import React, { useState } from "react";
import "../App.css";
import "../index.css";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min.js";
import "../css/styles.css";
import "../css/animate.css";
import "../icon/icomoon/style.css";

import PageTitleImage from "../components/PageTitleImage";
import mainImg from "../images/products/jewelry/product-13.jpg";
import hoverImg from "../images/products/jewelry/product-14.jpg";
import altImg1 from "../images/products/jewelry/product-15.jpg";
import altImg2 from "../images/products/jewelry/product-16.jpg";

const ProductDetail = () => {
  const [selectedImage, setSelectedImage] = useState(mainImg);

  return (
    <>
      <PageTitleImage />

      {/* -------- Product Detail Section -------- */}
      <section className="product-detail-section py-5">
        <div className="container">
          <div className="row align-items-center">

            {/* ---------- Left: Product Images ---------- */}
            <div className="col-md-6 mb-4">
              <div className="product-main-image text-center mb-3">
                <img
                  src={selectedImage}
                  alt="Product"
                  className="img-fluid rounded shadow"
                  style={{ maxHeight: "400px", objectFit: "cover" }}
                />
              </div>

              {/* Thumbnail Images */}
              <div className="d-flex justify-content-center gap-3">
                {[mainImg, hoverImg, altImg1, altImg2].map((img, i) => (
                  <img
                    key={i}
                    src={img}
                    alt={`Thumbnail ${i + 1}`}
                    className={`img-thumbnail rounded shadow-sm ${
                      selectedImage === img ? "border-warning" : ""
                    }`}
                    style={{
                      width: "80px",
                      height: "80px",
                      objectFit: "cover",
                      cursor: "pointer",
                    }}
                    onClick={() => setSelectedImage(img)}
                  />
                ))}
              </div>
            </div>

            {/* ---------- Right: Product Info ---------- */}
            <div className="col-md-6">
              <h2 className="fw-bold mb-3">18K Gold Friendship Ring</h2>
              <p className="text-muted mb-3">Category: Artificial Jewellery</p>

              <div className="price mb-3">
                <span className="text-decoration-line-through text-muted me-2">
                  $109.99
                </span>
                <span className="fw-bold text-danger fs-4">$89.99</span>
              </div>

              <p className="text-secondary mb-4">
                This elegant 18K gold-plated friendship ring is perfect for every occasion.
                Designed with premium polish and sparkling finish, it symbolizes everlasting bonds.
              </p>

              {/* Add to Cart & Wishlist Buttons */}
              <div className="d-flex gap-3 mb-4">
                <button className="btn btn-dark px-4 py-2">
                  <span className="icon icon-shopping-cart-simple me-2"></span>
                  Add to Cart
                </button>
                <button className="btn btn-outline-dark px-4 py-2">
                  <span className="icon icon-heart me-2"></span>
                  Add to Wishlist
                </button>
              </div>

              {/* Social Share Icons */}
              <div className="social-share mt-4">
                <p className="fw-bold mb-2">Share this product:</p>
                <div className="d-flex gap-3">
                  <a href="#" className="text-dark">
                    <i className="icon icon-facebook"></i>
                  </a>
                  <a href="#" className="text-dark">
                    <i className="icon icon-instagram"></i>
                  </a>
                  <a href="#" className="text-dark">
                    <i className="icon icon-twitter"></i>
                  </a>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default ProductDetail;
